Each test case exercises a minimal piece of the syscall's functionality. Each must be registered with the test_case! macro. crate::test_case! { /// open do not update parent directory ctime and mtime fields if /// the file previously existed. exists_no_update
}
fn exists_no_update(ctx: &mut TestContext) { let file = ctx.create(FileType::Regular).unwrap(); assert_times_unchanged() .path(ctx.base_path(), CTIME | MTIME) .execute(ctx, false, || { assert!(open_wrapper(&file, Mode::from_bits_truncate(0o755)).is_ok()); });
}

