Test cases have the same structure than usual Rust tests, that is unwraping Results and using assertion macros (assert and assert_eq), the exception being that it should take a &mut TestContext parameter. It might also take a FileType argument if required. It also needs an additional declaration with the test_case! macro alongside the function, with the function name being the only mandatory argument. For example: // chmod/00.t:L58
crate::test_case! { /// chmod updates ctime when it succeeds update_ctime => [Regular, Dir, Fifo, Block, Char, Socket]
}
fn update_ctime(ctx: &mut TestContext, f_type: FileType) { let path = ctx.create(f_type).unwrap(); assert_ctime_changed(ctx, &path, || { assert!(chmod(&path, Mode::from_bits_truncate(0o111)).is_ok()); });
} All the structures and functions needed are documented in the pjdfstest crate, which you can obtain by running cargo doc --open in the rust directory or by visiting the documentation .

