Some test cases need functions only available when they are run serialized, especially when they affect the whole process. An example is changing user (SerializedTestContext::as_user). To have access to these functions, the test should be declared with a SerializedTestContext parameter in place of TestContext and the serialized keyword should be prepended before features and root requirement. For example: crate::test_case! { /// link changes neither ctime of file nor ctime or mtime of parent when it fails // link/00.t#77 unchanged_ctime_fails, serialized, root => [Regular, Fifo, Block, Char, Socket]
}
fn unchanged_ctime_fails(ctx: &mut SerializedTestContext, ft: FileType) { let file = ctx.create(ft).unwrap(); let new_path = ctx.gen_path(); let user = ctx.get_new_user(); assert_times_unchanged() .path(&file, CTIME) .path(ctx.base_path(), CTIME | MTIME) .execute(ctx, false, || { ctx.as_user(user, None, || { assert!(matches!( link(&file, &new_path), Err(Errno::EPERM | Errno::EACCES) )); }) });
}
